import Link from "./link";

export default function LinkNavigation({className,classNameDiv, href, style, src, text, alt = ""}) {
    return (
            <div className={classNameDiv}>
                <img src={src} alt={alt}/>
                <Link className={className} text={text}/>
            </div>
    )
}
